rational_approx::rational_approx(double lower_bound, double upper_bound) {
	alpha_hi.resize(N_MAX_SHIFTS+1);
	beta_hi.resize(N_MAX_SHIFTS+1);
	alpha_inv_hi.resize(N_MAX_SHIFTS+1);
	beta_inv_hi.resize(N_MAX_SHIFTS+1);

	alpha_lo.resize(N_MAX_SHIFTS+1);
	beta_lo.resize(N_MAX_SHIFTS+1);
	alpha_inv_lo.resize(N_MAX_SHIFTS+1);
	beta_inv_lo.resize(N_MAX_SHIFTS+1);
	if((lower_bound >= 0.0025) && (upper_bound<=16.0)) {
		// use small volume set of rational approximations
		initialise_rational_approx_SMALL();
	} else if ((lower_bound >= 4.0e-6) && (upper_bound<=5.3)) {
		// use large volume set of rational approximations
		initialise_rational_approx_LARGE();
	} else {
		std::cout << "No suitable rational approx available for requested range [" << lower_bound << ", " << upper_bound << "]" << std::endl;
		exit(1);
	}
}

